 import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import './index.css'; // A basic CSS file for styling
import { GoogleOAuthProvider } from '@react-oauth/google';

root.render(
  <React.StrictMode>
    <GoogleOAuthProvider clientId="1012880997973-b085emkn01huhic0im0g1h4s5t6ebjtf.apps.googleusercontent.com">
       {/* ... your app ... */}
    </GoogleOAuthProvider>
  </React.StrictMode>
);
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>
);
